import React, { Component } from 'react';
import {
	BrowserRouter as Router,
	Routes,
	Route,
	NavLink,
	Outlet,
	useParams,
	useLocation,
} from 'react-router-dom';
import style from './ProjectSubNav.module.css';

const ProjectSubNav = (props) => {
	let projects = props.data.projects.edges;
	console.log(projects);

	const onHover = () => {
		console.log('hi');
	};

	return (
		<div>
			<div>
				{projects.map((project) => (
					<NavLink
						to={`/project/${project.node.slug}/`}
						onClick={props.handleClick}
					>
						<div onMouseOver={onHover}>{project.node.title}</div>
					</NavLink>
				))}
			</div>
		</div>
	);
};

export default ProjectSubNav;
